import React, { useState } from 'react';

export default function Card () {
    const [listofTodos] = useState([])
    return (
        <div>
            {listofTodos.map(todo => {
                return (
                    <ul>
                        <li>{todo.content}</li>
                    </ul>
                )
            })}
        </div>
    );
}
